import React from "react";
import { Col, Container, Row } from "react-bootstrap";
import Image from 'react-bootstrap/Image'

const MainMid: React.FC = () => {
    return (
        <Container>
            <Row>
                <Col xl={3} md={4}>
                    <Image src={`${process.env.PUBLIC_URL}/bento_001.png`} fluid roundedCircle />
                </Col>
                <Col xl={3} md={4}>
                    <Image src={`${process.env.PUBLIC_URL}/bento_002.png`} fluid roundedCircle />
                </Col>
            </Row>
            <Row>
                <Col xl={3} md={4}>
                    <Image src={`${process.env.PUBLIC_URL}/bento_004.png`} fluid roundedCircle />
                </Col>
                <Col xl={3} md={4}>
                    <Image src={`${process.env.PUBLIC_URL}/bento_005.png`} fluid roundedCircle />
                </Col>
            </Row>
        </Container>
    );
}

export default MainMid;
